import React from "react";

import { HCardState } from "common/types";

import {
  HCardFormSection,
  HCardFormTitle,
  FieldSet,
  Legend,
  FieldSetContainer,
  Label,
  LabelText,
  Input,
  ButtonsContainer,
  Button,
} from "./styled";

interface Props {
  hCardState: HCardState;
}

export const HCardForm = ({ hCardState }: Props) => {
  const {
    givenName,
    surname,
    email,
    phone,
    houseNameOrNumber,
    street,
    suburb,
    state,
    postcode,
    country,
  } = hCardState;

  const handleChange = () => {};
  return (
    <HCardFormSection>
      <HCardFormTitle>hCard Builder</HCardFormTitle>
      <form>
        <FieldSet>
          <Legend>Personal Details</Legend>
          <FieldSetContainer>
            <Label htmlFor="givenName">
              <LabelText>Given Name</LabelText>
              <Input
                id="givenName"
                name="givenName"
                type="text"
                // value={givenName}
                onChange={handleChange}
              />
            </Label>
            <Label htmlFor="surname">
              <LabelText>Surname</LabelText>
              <Input
                id="surname"
                name="surname"
                type="text"
                // value={surname}
                onChange={handleChange}
              />
            </Label>
            <Label htmlFor="email">
              <LabelText>Email</LabelText>
              <Input
                id="email"
                name="email"
                type="email"
                // value={email}
                onChange={handleChange}
              />
            </Label>
            <Label htmlFor="phone">
              <LabelText>Phone</LabelText>
              <Input
                id="phone"
                name="phone"
                type="phone"
                // value={phone}
                onChange={handleChange}
              />
            </Label>
          </FieldSetContainer>
        </FieldSet>
        <FieldSet>
          <Legend>Address</Legend>
          <FieldSetContainer>
            <Label htmlFor="houseNumberOrName">
              <LabelText>House Name or #</LabelText>
              <Input
                id="houseNumberOrName"
                name="houseNumberOrName"
                type="text"
                // value={houseNumberOrName}
                onChange={handleChange}
              />
            </Label>
            <Label htmlFor="street">
              <LabelText>Street</LabelText>
              <Input
                id="street"
                name="street"
                type="text"
                // value={street}
                onChange={handleChange}
              />
            </Label>
            <Label htmlFor="suburb">
              <LabelText>Suburb</LabelText>
              <Input
                id="suburb"
                name="suburb"
                type="text"
                // value={suburb}
                onChange={handleChange}
              />
            </Label>
            <Label htmlFor="state">
              <LabelText>State</LabelText>
              <Input
                id="state"
                name="state"
                type="text"
                // value={state}
                onChange={handleChange}
              />
            </Label>
            <Label htmlFor="postcode">
              <LabelText>Postcode</LabelText>
              <Input
                id="postcode"
                name="postcode"
                type="text"
                // value={postcode}
                onChange={handleChange}
              />
            </Label>
            <Label htmlFor="country">
              <LabelText>Country</LabelText>
              <Input
                id="country"
                name="country"
                type="text"
                // value={country}
                onChange={handleChange}
              />
            </Label>
          </FieldSetContainer>
        </FieldSet>
        <ButtonsContainer>
          <Button type="button" onClick={(e) => e.preventDefault()}>
            Upload Avatar
          </Button>
          <Button
            type="button"
            buttonStyle="primary"
            onClick={(e) => e.preventDefault()}
          >
            Create hCard
          </Button>
        </ButtonsContainer>
      </form>
    </HCardFormSection>
  );
};
